import React from 'react';

const ComingSoon = ({fetchMovies}) => {
  let query= '?primary_release_date.gte=2019-08-15&primary_release_date.lte=2019-09-10';
  fetchMovies('discover', query);
  return (
    <div className="title-container">Coming Soon</div>
  )
}

export default ComingSoon;
